import React, { Component } from 'react'

export default class Interest extends Component {
    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
          items: []
        };
      }

      componentDidMount() {
        fetch("http://localhost:46204/odata/Interests")
          .then(res => res.json())
          .then(
            (result) => {
              this.setState({
                isLoaded: true,
                items: result.items
              });
            },
            // Note: it's important to handle errors here
            // instead of a catch() block so that we don't swallow
            // exceptions from actual bugs in components.
            (error) => {
              this.setState({
                isLoaded: true,
                error
              });
              console.log(error)
            }
          )
      }
            render() {
                const { error, isLoaded, items } = this.state;
                if (error) {
                return <div>Error: {error.message}</div>;
                } else if (!isLoaded) {
                return <div>Loading...</div>;
                } else {
                return (
                    <div>
                    <section className="content-header">
                <h1>
                    Interest
                    <small>Select your Interests</small>
                </h1>
                <ol className="breadcrumb">
                    <li><a href="fake_url"><i className="fa fa-dashboard" /> Home</a></li>
                    <li className="active">Interests</li>
                </ol>
                </section>

                <section class="content">
               
                <div className="col-md-3 col-sm-6 col-xs-12">
                    <div className="info-box">
                    <span className="info-box-icon bg-red"><i className="fa fa-star-o" /></span>
                    <div className="info-box-content">
                        <span className="info-box-text">Likes</span>
                        <span className="info-box-number">{}</span>
                    </div>
                    {/* /.info-box-content */}
                    </div>
                    {/* /.info-box */}
                </div>
            </section>

        </div>
                )
    }
}
}
